import React from 'react';
import s from './Dialogs.module.css'
import NavLink from "react-router-dom/es/NavLink";


const DialogItem = (props) => {
    return (
        <div className={s.dialog + s.active}>
            <NavLink to={'/dialogs/' + props.id}>{props.name}</NavLink>
        </div>
    )
};

const Massage = (props) => {
    return(
        <div>
            {props.massage}
        </div>
    )
};

const Dialogs = (props) => {
    const data = [
        {id: 1, name: 'Роман'},
        {id: 2, name: 'Сергей'},
        {id: 3, name: 'Артем'},
        {id: 4, name: 'Катя'},
        {id: 5, name: 'Маша'},
        {id: 6, name: 'Яна'}
    ];

    const dataMassage = [
        {id: 1, massage: 'Привет это мое первое сообщение в моей социальной сети'},
        {id: 2, massage: 'Как дела братуха'},
        {id: 3, massage: 'Чувак мож ну его этот карантин, го футбол'},
        {id: 4, massage: 'Где ты пропал?'},
        {id: 5, massage: 'Сегодня в 20:00?'},
        {id: 6, massage: 'Напонимаю что в четверг вечером курс по react'}
    ]
    return (
        <div className={`${s.dialogs} ${s.grid}`}>
            <div className={s.dialogsItem}>
                {data.map(el => {
                    return <DialogItem name={el.name} id={el.id}/>
                })}
            </div>
            <div className={s.massages}>
                {dataMassage.map(el => {<Massage massage={el.massage}/>})}

            </div>
        </div>
    )
};


export default Dialogs;
